// import 'bootstrap/dist/css/bootstrap.min.css';
import './timeSelect.css'

function TimeSelect() {
    // const [isSelected, onClick] = useState(false);
    const onClick =()=>{
      isSelected("true");
    }
  
    return (
      <div id='time'>
        <div className='firstRow'>
        <button className={'Timebtn ${isSelected ? "selectedTime" : ""}'}>11:00</button>
        </div>
        <div>
        <button className='Timebtn'>12:00</button>
        <button className='Timebtn'>13:00</button>
        <button className='Timebtn'>14:00</button>
